import { useEffect, useState } from "react";
import axios from "axios";

const ArrayMap = () => {
  const [hobbies, setHobbies] = useState([
    ["I am level 38 and counting!"]
  ]);

  useEffect(() => {
    hobbies.push("i am on team valor");
    hobbies.push("add me! my trainer code is: 0126 9490 6285");
    console.log(hobbies);
    setHobbies(["I am level 38 and counting!", "I am level 38 and counting!", "I am level 38 and counting!"]);
    console.log(hobbies.length);
  });


  return (
    <>
      {hobbies.map((num, index) => {
        console.log({ index, num });
        return (
          <ul>
            <li>{num}, {index}</li>
          </ul>
        );
      })}
    </>
  );
};

export default ArrayMap;
